import React from 'react';

type Button = {
    name:string;
    started:()=>void
    value:number;
}

export  const Button = (props:Button) => {
    return (
        <span>
            <button disabled={props.value===5} onClick={props.started}>{props.name}</button>
        </span>
    );
};
